import React, { Component } from 'react'
import AppContext from '../context'

export default class UserLine extends Component {
  static contextType = AppContext

  render() {
    return (
      <div className='user-queue'>
        { this.context.queue.map(user => <div>
          {user}
        </div>
        )}
      </div>
    )
  }
}
